import React from "react";
import "./account.css";
import 'antd/dist/antd.css'; // or 'antd/dist/antd.less'
import { Button, Form, Input,Select,Image,Typography} from 'antd';
import proPick from "../../assets/images/account/account-pro-img.svg";

function Account() {
  return (
    <>
        <div className="title-wrapper"><h3>Account</h3></div>
        <Form
            name="wrap"
            labelCol={{
            flex: '110px',
            }}
            labelAlign="left"
            labelWrap
            wrapperCol={{
            flex: 1,
            }}
            colon={false}
            className="account-wrapper"
        >
            <div className="content-wrapper-1">
                <Form.Item>
                    <Image
                        width={100}
                        src={proPick}
                    />
                    <Typography.Paragraph
                        className="upload-name"
                    >
                        Upload Image
                    </Typography.Paragraph>
                </Form.Item>
                <Form.Item
                    label="First Name"
                    name="name"
                    className="f-name"
                    rules={[
                        {
                        required: true,
                        },
                    ]}
                >  
                    <Input />
                </Form.Item>

                <Form.Item
                    label="Last Name"
                    name="lastName"
                    className="l-name"
                    rules={[
                        {
                        required: true,
                        },
                    ]}
                >
                <Input />
                </Form.Item>
                {/* <Form.Item label=" ">
                    <Button type="primary" htmlType="submit">
                        Save
                    </Button>
                    <Button type="primary">
                        Save
                    </Button>
                </Form.Item> */}
            </div>
        </Form>
    </>
  )
}

export default Account
